INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Demon Slayer -Kimetsu no Yaiba- The Movie: Mugen Train', 'demon_slayer_-kimetsu_no_yaiba-_the_movie:_mugen_train.webp', 'Tanjiro Kamado, joined with Inosuke Hashibira, a boy raised by boars who wears a boar's head, and Zenitsu Agatsuma, a scared boy who reveals his true power when he sleeps, boards the Infinity Train on a new mission with the Fire Hashira, Kyojuro Rengoku, to defeat a demon who has been tormenting the people and killing the demon slayers who oppose it!', '15800000', '503063688', '117', '2020-10-16');
