INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Detective Knight: Rogue', 'detective_knight:_rogue.webp', 'As Los Angeles prepares for Halloween, mask-wearing armed robbers critically wound detective James Knight’s partner in a shootout following a heist. With Knight in hot pursuit, the bandits flee L.A. for New York, where the detective’s dark past collides with his present case and threatens to tear his world apart…unless redemption can claim Knight first.', '0', '0', '105', '2022-10-21');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Transformers: Rise of the Beasts', 'transformers:_rise_of_the_beasts.webp', 'A ‘90s globetrotting adventure that introduces the Maximals, Predacons, and Terrorcons to the existing battle on earth between Autobots and Decepticons.', '200000000', '0', '0', '2023-06-07');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Avengers: Endgame', 'avengers:_endgame.webp', 'After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos' actions and restore order to the universe once and for all, no matter what consequences may be in store.', '356000000', '2799439100', '181', '2019-04-24');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Dead for a Dollar', 'dead_for_a_dollar.webp', 'In 1897, veteran bounty hunter Max Borlund is deep into Mexico where he encounters professional gambler and outlaw Joe Cribbens — a sworn enemy he sent to prison years before. Max is on a mission to find and return Rachel Kidd, the wife of a wealthy businessman, who as the story is told to Max, has been abducted by Buffalo Soldier Elijah Jones. Max is ultimately faced with a showdown to save honor.', '0', '0', '106', '2022-09-30');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Viking Wolf', 'viking_wolf.webp', 'After witnessing a grotesque murder at a party in her new town, a teenager starts having strange visions and bizarre desires.', '0', '0', '97', '2022-11-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Shrek', 'shrek.webp', 'It ain't easy bein' green -- especially if you're a likable (albeit smelly) ogre named Shrek. On a mission to retrieve a gorgeous princess from the clutches of a fire-breathing dragon, Shrek teams up with an unlikely compatriot -- a wisecracking donkey.', '60000000', '487853320', '90', '2001-05-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Temptation of Aunt 2', 'temptation_of_aunt_2.webp', 'Se-min lives alone. He was having a good time with his girlfriend, Mi-ho, when they suddenly feel someone's eyes on them and turn around to see a woman looking at them with a blank face. It turns out the woman is Se-min's mother's friend, Ji-hye. She's packed up her things from abroad and moved back to Korea very suddenly. She'd called her childhood friend, Se-min's mother, and they decided she would live with Se-min for 3 days. Mi-ho is angry about Ji-hye. She tells Se-min to make her leave, but he can't do that and Mi-ho leaves angrily. Se-min and Ji-hye are living together for 3 days. Ji-hye comforts Se-min with some drinks, but he blacks out, only to wake up the next day and retrace his memory to the hot night they had.', '0', '0', '72', '2019-07-05');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Little Mermaid', 'the_little_mermaid.webp', 'The youngest of King Triton’s daughters, and the most defiant, Ariel longs to find out more about the world beyond the sea, and while visiting the surface, falls for the dashing Prince Eric. With mermaids forbidden to interact with humans, Ariel makes a deal with the evil sea witch, Ursula, which gives her a chance to experience life on land, but ultimately places her life – and her father’s crown – in jeopardy.', '0', '0', '0', '2023-05-24');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Operation Fortune: Ruse de Guerre', 'operation_fortune:_ruse_de_guerre.webp', 'Special agent Orson Fortune and his team of operatives recruit one of Hollywood's biggest movie stars to help them on an undercover mission when the sale of a deadly new weapons technology threatens to disrupt the world order.', '50000000', '35800000', '114', '2023-01-04');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Inspector Sun and the Curse of the Black Widow', 'inspector_sun_and_the_curse_of_the_black_widow.webp', 'Shanghai, 1934. In an insect world parallel to that of humans, veteran Inspector Sun, a lone spider, leads his last mission against his archenemy the Red Locust, before embarking on a well-deserved retirement. His vacation aboard a Pan Am clipper between Shanghai and San Francisco comes to an abrupt end when millionaire Dr. Spindelthorp is found murdered. What begins as a routine case for Sun will ultimately decide the fate of humanity.', '0', '0', '90', '2022-12-28');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Hacksaw Ridge', 'hacksaw_ridge.webp', 'WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people and becomes the first Conscientious Objector in American history to receive the Congressional Medal of Honor.', '40000000', '175302354', '139', '2016-10-07');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Disenchanted', 'disenchanted.webp', 'Disillusioned with life in the city, feeling out of place in suburbia, and frustrated that her happily ever after hasn’t been so easy to find, Giselle turns to the magic of Andalasia for help. Accidentally transforming the entire town into a real-life fairy tale and placing her family’s future happiness in jeopardy, she must race against time to reverse the spell and determine what happily ever after truly means to her and her family.', '0', '0', '120', '2022-11-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Quintessential Quintuplets Movie', 'the_quintessential_quintuplets_movie.webp', 'When five lovely young girls who hate studying hire part-time tutor Futaro, he guides not only their education but also their hearts. Time spent has brought them all closer, with feelings growing within the girls and Futaro. As they finish their third year of high school and their last school festival approaches, they set their sights on what’s next. Is there a future with one of them and Futaro?', '0', '17288993', '136', '2022-05-20');
