INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Wolf Hound', 'wolf_hound.webp', 'Inspired by the real-life German special operations unit KG 200 that shot down, repaired, and flew Allied aircraft as Trojan horses, "Wolf Hound" takes place in 1944 German-occupied France and follows the daring exploits of Jewish-American fighter pilot Captain David Holden. Ambushed behind enemy lines, Holden must rescue a captured B-17 Flying Fortress crew, evade a ruthless enemy stalking him at every turn, and foil a plot that could completely alter the outcome of World War II.', '0', '0', '127', '2022-06-03');
