INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Lost City', 'the_lost_city.webp', 'Reclusive author Loretta Sage writes about exotic places in her popular adventure novels that feature a handsome cover model named Alan. While on tour promoting her new book with Alan, Loretta gets kidnapped by an eccentric billionaire who hopes she can lead him to the ancient city's lost treasure that featured in her latest story. Alan, determined to prove he can be a hero in real life and not just on the pages of her books, sets off to rescue her.', '74000000', '190844029', '112', '2022-03-24');
