INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Lion King', 'the_lion_king.webp', 'A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?', '45000000', '763455561', '89', '1994-06-23');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Morbius', 'morbius.webp', 'Dangerously ill with a rare blood disorder, and determined to save others suffering his same fate, Dr. Michael Morbius attempts a desperate gamble. What at first appears to be a radical success soon reveals itself to be a remedy potentially worse than the disease.', '75000000', '167460961', '105', '2022-03-30');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Lesson Plan', 'lesson_plan.webp', 'After a teacher dies, his best friend — a former cop — takes a job at the school where he worked to confront the gang he thinks was responsible.', '0', '0', '101', '2022-11-23');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Maneater', 'maneater.webp', 'A group of friends on vacation in a seeming island paradise are stalked by an unrelenting great white after an accident leaves them stranded and left for dead.', '0', '0', '86', '2022-08-26');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Jack in the Box: Awakening', 'the_jack_in_the_box:_awakening.webp', 'When a vintage Jack-in-the-box is opened by a dying woman, she enters into a deal with the demon within that would see her illness cured in return for helping it claim six innocent victims.', '0', '195189', '89', '2022-02-24');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Coraline', 'coraline.webp', 'A young girl discovers an idealized parallel universe behind a secret door in her new home, unaware that it contains a sinister secret.', '60000000', '124600000', '100', '2009-02-05');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('PAW Patrol: The Movie', 'paw_patrol:_the_movie.webp', 'Ryder and the pups are called to Adventure City to stop Mayor Humdinger from turning the bustling metropolis into a state of chaos.', '26000000', '144327371', '86', '2021-08-09');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Your Name.', 'your_name..webp', 'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.', '0', '357986087', '106', '2016-08-26');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Teasing Master Takagi-san: The Movie', 'teasing_master_takagi-san:_the_movie.webp', 'Takagi and Nishikata are in their final year of middle school, and have both anxiety and hope for the future. During the summer of their final year, on the day before summer vacation starts, the two find a kitten that they name Hana. They decide to take care of the kitten themselves until they can find its mother.', '0', '0', '73', '2022-06-10');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Whisper', 'whisper.webp', 'A young Nurse is assigned to look after a patient in a remote location in the English countryside. As the night continues she finds herself terrorized by an unseen force that is connected with her patient.', '20000', '0', '76', '2022-01-23');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Boston Strangler', 'boston_strangler.webp', 'Reporters Loretta McLaughlin and Jean Cole bravely pursue the story of the Boston Strangler at great personal risk, putting their own lives on the line in their quest to uncover the truth.', '0', '0', '112', '2023-03-17');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Mortal Kombat', 'mortal_kombat.webp', 'Washed-up MMA fighter Cole Young, unaware of his heritage, and hunted by Emperor Shang Tsung's best warrior, Sub-Zero, seeks out and trains with Earth's greatest champions as he prepares to stand against the enemies of Outworld in a high stakes battle for the universe.', '20000000', '84426031', '110', '2021-04-07');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Clifford the Big Red Dog', 'clifford_the_big_red_dog.webp', 'As Emily struggles to fit in at home and at school, she discovers a small red puppy who is destined to become her best friend. When Clifford magically undergoes one heck of a growth spurt, becomes a gigantic dog and attracts the attention of a genetics company, Emily and her Uncle Casey have to fight the forces of greed as they go on the run across New York City. Along the way, Clifford affects the lives of everyone around him and teaches Emily and her uncle the true meaning of acceptance and unconditional love.', '64000000', '107347356', '97', '2021-11-10');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Fullmetal Alchemist: The Revenge of Scar', 'fullmetal_alchemist:_the_revenge_of_scar.webp', 'The Elric brothers meet their toughest opponent yet — a lone serial killer with a large scar on his forehead.', '0', '0', '125', '2022-05-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Halloween Ends', 'halloween_ends.webp', 'Four years after the events of Halloween in 2018, Laurie has decided to liberate herself from fear and rage and embrace life. But when a young man is accused of killing a boy he was babysitting, it ignites a cascade of violence and terror that will force Laurie to finally confront the evil she can’t control, once and for all.', '20000000', '104186860', '111', '2022-10-12');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Raya and the Last Dragon', 'raya_and_the_last_dragon.webp', 'Long ago, in the fantasy world of Kumandra, humans and dragons lived together in harmony. But when an evil force threatened the land, the dragons sacrificed themselves to save humanity. Now, 500 years later, that same evil has returned and it’s up to a lone warrior, Raya, to track down the legendary last dragon to restore the fractured land and its divided people.', '100000000', '130423032', '107', '2021-03-03');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Lou', 'lou.webp', 'A young girl is kidnapped during a powerful storm. Her mother joins forces with her mysterious neighbour to set off in pursuit of the kidnapper. Their journey will test their limits and expose the dark secrets of their past.', '0', '0', '107', '2022-09-23');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Emancipation', 'emancipation.webp', 'Inspired by the gripping true story of a man who would do anything for his family—and for freedom. When Peter, an enslaved man, risks his life to escape and return to his family, he embarks on a perilous journey of love and endurance.', '0', '0', '132', '2022-12-02');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Summer Ghost', 'summer_ghost.webp', 'An urban legend says that lighting fireworks at an abandoned airfield will beckon the "summer ghost," a spirit that can answer any question. Three teenagers, Tomoya, Aoi, and Ryo, each have their own reason to show up one day. When a ghost named Ayane appears, she reveals she is only visible to those "who are about to touch their death." Compelled by the ghost and her message, Tomoya begins regularly visiting the airfield to uncover the true purpose of her visits.', '0', '0', '40', '2021-11-12');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Princess and the Frog', 'the_princess_and_the_frog.webp', 'A waitress, desperate to fulfill her dreams as a restaurant owner, is set on a journey to turn a frog prince back into a human being, but she has to face the same problem after she kisses him.', '105000000', '270997378', '98', '2009-12-08');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Missing', 'missing.webp', 'When her mother disappears while on vacation in Colombia with her new boyfriend, June’s search for answers is hindered by international red tape. Stuck thousands of miles away in Los Angeles, June creatively uses all the latest technology at her fingertips to try and find her before it’s too late. But as she digs deeper, her digital sleuthing raises more questions than answers... and when June unravels secrets about her mom, she discovers that she never really knew her at all.', '1000000', '45013424', '111', '2023-01-19');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Scream 3', 'scream_3.webp', 'While Sidney lives in safely guarded seclusion, bodies begin dropping around the Hollywood set of STAB 3, the latest movie based on the gruesome Woodsboro killings.', '40000000', '161834276', '116', '2000-02-03');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Shrek Forever After', 'shrek_forever_after.webp', 'A bored and domesticated Shrek pacts with deal-maker Rumpelstiltskin to get back to feeling like a real ogre again, but when he's duped and sent to a twisted version of Far Far Away—where Rumpelstiltskin is king, ogres are hunted, and he and Fiona have never met—he sets out to restore his world and reclaim his true love.', '165000000', '752600867', '93', '2010-05-16');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('365 Days: This Day', '365_days:_this_day.webp', 'Laura and Massimo are back and hotter than ever. But the reunited couple's new beginning is complicated by Massimo’s family ties and a mysterious man who enters Laura’s life to win her heart and trust, at any cost.', '0', '0', '111', '2022-04-27');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Last: Naruto the Movie', 'the_last:_naruto_the_movie.webp', 'Two years after the events of the Fourth Great Ninja War, the moon that Hagoromo Otsutsuki created long ago to seal away the Gedo Statue begins to descend towards the world, threatening to become a meteor that would destroy everything on impact. Amidst this crisis, a direct descendant of Kaguya Otsutsuki named Toneri Otsutsuki attempts to kidnap Hinata Hyuga but ends up abducting her younger sister Hanabi. Naruto and his allies now mount a rescue mission before finding themselves embroiled in a final battle to decide the fate of everything.', '903852', '19840000', '114', '2014-12-06');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Conjuring 2', 'the_conjuring_2.webp', 'Lorraine and Ed Warren travel to north London to help a single mother raising four children alone in a house plagued by malicious spirits.', '40000000', '321834351', '134', '2016-06-08');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Slumberland', 'slumberland.webp', 'A young girl discovers a secret map to the dreamworld of Slumberland, and with the help of an eccentric outlaw, she traverses dreams and flees nightmares, with the hope that she will be able to see her late father again.', '35000000', '0', '117', '2022-11-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Resident Evil: Welcome to Raccoon City', 'resident_evil:_welcome_to_raccoon_city.webp', 'Once the booming home of pharmaceutical giant Umbrella Corporation, Raccoon City is now a dying Midwestern town. The company’s exodus left the city a wasteland…with great evil brewing below the surface. When that evil is unleashed, the townspeople are forever…changed…and a small group of survivors must work together to uncover the truth behind Umbrella and make it through the night.', '40000000', '38600612', '107', '2021-11-24');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Monstrous', 'monstrous.webp', 'Laura, traumatized by an abusive relationship, runs away from her former husband with her seven-year-old son Cody. But in their new, idyllic and remote sanctuary, they find they have another, bigger and more terrifying monster to deal with…', '0', '138450', '89', '2022-05-13');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Ratatouille', 'ratatouille.webp', 'Remy, a resident of Paris, appreciates good food and has quite a sophisticated palate. He would love to become a chef so he can create and enjoy culinary masterpieces to his heart's delight. The only problem is, Remy is a rat. When he winds up in the sewer beneath one of Paris' finest restaurants, the rodent gourmet finds himself ideally placed to realize his dream.', '150000000', '623726000', '111', '2007-06-28');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Mari(dos)', 'mari(dos).webp', 'Emilio and Tono both receive phone calls that their wives are in comas after a ski-resort avalanche. At the hospital desk, they make a shocking discovery: their wives are, in fact, the same person … Laura. Forced to wait together until Laura regains consciousness, Emilio and Toni battle to prove who is her one and only true husband.', '0', '0', '0', '2023-03-10');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Crawlspace', 'crawlspace.webp', 'After witnessing a brutal murder in a cabin, a man hides in a crawlspace while the killers scour the property for a hidden fortune. As they draw nearer, he must decide if the crawlspace will be his tomb or the battleground in his fight for survival.', '0', '0', '90', '2022-03-31');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Matrix Resurrections', 'the_matrix_resurrections.webp', 'Plagued by strange memories, Neo's life takes an unexpected turn when he finds himself back inside the Matrix.', '190000000', '156497322', '147', '2021-12-16');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Guardians of the Galaxy Holiday Special', 'the_guardians_of_the_galaxy_holiday_special.webp', 'On a mission to make Christmas unforgettable for Quill, the Guardians head to Earth in search of the perfect present.', '0', '0', '45', '2022-11-25');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Scream 2', 'scream_2.webp', 'Away at college, Sidney thought she'd finally put the shocking murders that shattered her life behind her... until a copycat killer begins acting out a real-life sequel.', '24000000', '172363301', '120', '1997-12-12');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Fast & Furious Presents: Hobbs & Shaw', 'fast_&_furious_presents:_hobbs_&_shaw.webp', 'Ever since US Diplomatic Security Service Agent Hobbs and lawless outcast Shaw first faced off, they just have traded smack talk and body blows. But when cyber-genetically enhanced anarchist Brixton's ruthless actions threaten the future of humanity, they join forces to defeat him.', '200000000', '760098996', '137', '2019-08-01');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Terrifier', 'terrifier.webp', 'On Halloween night, a young woman finds herself as the obsession of a sadistic murderer known as Art the Clown.', '100000', '0', '84', '2016-03-15');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Scrooge: A Christmas Carol', 'scrooge:_a_christmas_carol.webp', 'On a cold Christmas Eve, selfish miser Ebenezer Scrooge has one night left to face his past — and change the future — before time runs out.', '0', '0', '97', '2022-11-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Somebody I Used to Know', 'somebody_i_used_to_know.webp', 'On a trip to her hometown, workaholic Ally reminisces with her first love Sean, and starts to question everything about the person she's become. Things only get more confusing when she meets Sean's fiancé, Cassidy, who reminds her of the person she used to be.', '0', '0', '106', '2023-02-10');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Sisu', 'sisu.webp', 'Deep in the wilderness of Lapland, Aatami Korpi is searching for gold. From time to time, the overflight of bombers and the distant sounds of war can be heard in the autumn night. Finally, the hard work is rewarded and the gold dust in the pan grows into gold chunks, and Aatami sets out to take his gold treasure to the nearest city. After he stumbles upon Nazi patrol led by SS Obersturmführer Bruno Helldorf, a breathtaking and gold-hungry chase through the destroyed and mined Lapland wilderness begins.', '6200000', '0', '91', '2023-01-27');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Captain America: Civil War', 'captain_america:_civil_war.webp', 'Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.', '250000000', '1153337496', '147', '2016-04-27');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Croods: A New Age', 'the_croods:_a_new_age.webp', 'Searching for a safer habitat, the prehistoric Crood family discovers an idyllic, walled-in paradise that meets all of its needs. Unfortunately, they must also learn to live with the Bettermans -- a family that's a couple of steps above the Croods on the evolutionary ladder. As tensions between the new neighbors start to rise, a new threat soon propels both clans on an epic adventure that forces them to embrace their differences, draw strength from one another, and survive together.', '65000000', '215905815', '95', '2020-11-25');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Boruto: Naruto the Movie', 'boruto:_naruto_the_movie.webp', 'The spirited Boruto Uzumaki, son of Seventh Hokage Naruto, is a skilled ninja who possesses the same brashness and passion his father once had. However, the constant absence of his father, who is busy with his Hokage duties, puts a damper on Boruto's fire. He ends up meeting his father's friend Sasuke, and requests to become... his apprentice!? The curtain on the story of the new generation rises!', '0', '39500000', '95', '2015-08-07');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Iron Man', 'iron_man.webp', 'After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.', '140000000', '585174222', '126', '2008-04-30');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Free Guy', 'free_guy.webp', 'A bank teller called Guy realizes he is a background character in an open world video game called Free City that will soon go offline.', '110000000', '331526598', '115', '2021-08-11');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Inside Out', 'inside_out.webp', 'Growing up can be a bumpy road, and it's no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Riley's guiding emotions— Joy, Fear, Anger, Disgust and Sadness—live in Headquarters, the control centre inside Riley's mind, where they help advise her through everyday life and tries to keep things positive, but the emotions conflict on how best to navigate a new city, house and school.', '175000000', '857611174', '95', '2015-06-09');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Fifty Shades Darker', 'fifty_shades_darker.webp', 'When a wounded Christian Grey tries to entice a cautious Ana Steele back into his life, she demands a new arrangement before she will give him another chance. As the two begin to build trust and find stability, shadowy figures from Christian’s past start to circle the couple, determined to destroy their hopes for a future together.', '55000000', '378827494', '118', '2017-02-08');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Unbearable Weight of Massive Talent', 'the_unbearable_weight_of_massive_talent.webp', 'Creatively unfulfilled and facing financial ruin, Nick Cage must accept a $1 million offer to attend the birthday of a dangerous superfan. Things take a wildly unexpected turn when Cage is recruited by a CIA operative and forced to live up to his own legend, channeling his most iconic and beloved on-screen characters in order to save himself and his loved ones.', '30000000', '29116320', '107', '2022-04-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Suzume', 'suzume.webp', 'Suzume, 17, lost her mother as a little girl. On her way to school, she meets a mysterious young man. But her curiosity unleashes a calamity that endangers the entire population of Japan, and so Suzume embarks on a journey to set things right.', '0', '102258981', '122', '2022-11-11');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Halfaouine: Boy of the Terraces', 'halfaouine:_boy_of_the_terraces.webp', 'Twelve-year-old Noura dangles uncertainly in that difficult netherworld between childhood and adulthood. His growing libido has gotten him banned from the women's baths, where his mother took him when he was younger, but he's not yet old enough to participate in grown-up discussions with the men of his Tunisian village. Noura's only real friend is a troublemaker named Salih -- the village political outcast.', '0', '0', '98', '1990-09-14');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Frozen', 'frozen.webp', 'Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She's accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.', '150000000', '1274219009', '102', '2013-11-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Alienoid', 'alienoid.webp', 'Gurus in the late Goryeo dynasty try to obtain a fabled, holy sword, and humans in 2022 hunt down an alien prisoner that is locked in a human's body. The two parties cross paths when a time-traveling portal opens up.', '24457676', '0', '143', '2022-07-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Twilight', 'twilight.webp', 'When Bella Swan moves to a small town in the Pacific Northwest, she falls in love with Edward Cullen, a mysterious classmate who reveals himself to be a 108-year-old vampire. Despite Edward's repeated cautions, Bella can't stay away from him, a fatal move that endangers her own life.', '37000000', '393616788', '122', '2008-11-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Lion King', 'the_lion_king.webp', 'Simba idolizes his father, King Mufasa, and takes to heart his own royal destiny. But not everyone in the kingdom celebrates the new cub's arrival. Scar, Mufasa's brother—and former heir to the throne—has plans of his own. The battle for Pride Rock is ravaged with betrayal, tragedy and drama, ultimately resulting in Simba's exile. With help from a curious pair of newfound friends, Simba will have to figure out how to grow up and take back what is rightfully his.', '260000000', '1663075401', '118', '2019-07-12');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('All the Places', 'all_the_places.webp', 'Two siblings who haven't seen each other in 15 years mend their relationship while fulfilling a childhood dream: a motorcycle road trip through Mexico.', '0', '0', '97', '2023-02-14');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Last Manhunt', 'the_last_manhunt.webp', 'In 1909, Willie Boy and his love Carlota go on the run after he accidentally shoots her father in a confrontation gone terribly wrong. With President Taft coming to the area, the local sheriff leads two Native American trackers seeking justice for their “murdered” tribal leader.', '0', '0', '103', '2022-11-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Dragon Knight', 'dragon_knight.webp', 'Many years after the war has been lost, and all the dragons slain, a lone knight travels the lands of Agonos seeking to raise an army against the demon lord Abaddon. When a healer's vision reveals that one dragon still lives, and together with an eager young squire, the knight sets off in search of the fabled creature. As the armies of Abaddon descend on the human kingdoms, the dragon is their last hope of fending off the horde, before it lays waste to the lands of men. But does the creature even exist? And if it does, will it fight for them once more?', '0', '0', '99', '2022-03-21');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Grown Ups 2', 'grown_ups_2.webp', 'Lenny has relocated his family back to the small town where he and his friends grew up. This time around, the grown ups are the ones learning lessons from their kids on a day notoriously full of surprises—the last day of school.', '80000000', '247022278', '101', '2013-07-11');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Reading', 'the_reading.webp', 'After a deadly home invasion, Emma (Mo'Nique Hicks) copes by writing a book, but when a young psychic and her team perform a reading in her home, a new terror is unleashed.', '0', '0', '96', '2023-02-02');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Transformers: Age of Extinction', 'transformers:_age_of_extinction.webp', 'As humanity picks up the pieces, following the conclusion of "Transformers: Dark of the Moon," Autobots and Decepticons have all but vanished from the face of the planet. However, a group of powerful, ingenious businessman and scientists attempt to learn from past Transformer incursions and push the boundaries of technology beyond what they can control - all while an ancient, powerful Transformer menace sets Earth in his cross-hairs.', '210000000', '1104054072', '165', '2014-06-25');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Deadpool', 'deadpool.webp', 'The origin story of former Special Forces operative turned mercenary Wade Wilson, who, after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.', '58000000', '783100000', '108', '2016-02-09');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('After', 'after.webp', 'Tessa Young is a dedicated student, dutiful daughter and loyal girlfriend to her high school sweetheart. Entering her first semester of college, Tessa's guarded world opens up when she meets Hardin Scott, a mysterious and brooding rebel who makes her question all she thought she knew about herself -- and what she wants out of life.', '14000000', '69497587', '106', '2019-04-11');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Pirates of the Caribbean: On Stranger Tides', 'pirates_of_the_caribbean:_on_stranger_tides.webp', 'Captain Jack Sparrow crosses paths with a woman from his past, and he's not sure if it's love -- or if she's a ruthless con artist who's using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Anne's Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesn't know who to fear more: Blackbeard or the woman from his past.', '380000000', '1045713802', '137', '2011-05-14');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Twilight Saga: Breaking Dawn - Part 2', 'the_twilight_saga:_breaking_dawn_-_part_2.webp', 'After the birth of Renesmee, the Cullens gather other vampire clans in order to protect the child from a false allegation that puts the family in front of the Volturi.', '120000000', '829747654', '115', '2012-11-13');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Code Name Banshee', 'code_name_banshee.webp', 'Caleb, a former government assassin in hiding, who resurfaces when his protégé, the equally deadly killer known as Banshee, discovers a bounty has been placed on Caleb's head.', '0', '0', '93', '2022-07-01');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('After We Collided', 'after_we_collided.webp', 'Tessa finds herself struggling with her complicated relationship with Hardin; she faces a dilemma that could change their lives forever.', '0', '42000000', '105', '2020-09-02');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Cars 3', 'cars_3.webp', 'Blindsided by a new generation of blazing-fast racers, the legendary Lightning McQueen is suddenly pushed out of the sport he loves. To get back in the game, he will need the help of an eager young race technician with her own plan to win, inspiration from the late Fabulous Hudson Hornet, and a few unexpected turns. Proving that #95 isn't through yet will test the heart of a champion on Piston Cup Racing’s biggest stage!', '175000000', '383925276', '102', '2017-06-15');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Maze Runner', 'the_maze_runner.webp', 'Set in a post-apocalyptic world, young Thomas is deposited in a community of boys after his memory is erased, soon learning they're all trapped in a maze that will require him to join forces with fellow “runners” for a shot at escape.', '34000000', '348319861', '113', '2014-09-10');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Sword Art Online the Movie -Progressive- Aria of a Starless Night', 'sword_art_online_the_movie_-progressive-_aria_of_a_starless_night.webp', 'One month after Kayaba Akihiko's game of death began, the death toll continues to rise, two thousand players having already lost their lives to the ultra-difficult VRMMO world of Sword Art Online. On the day of the strategy meeting to plan out the first-floor boss battle, Kirito, a solo player who vows to fight alone to get stronger, runs into a rare, high-level female player. She gracefully dispatches powerful monsters with a single rapier that flashes like a shooting star in the night...', '0', '14037060', '97', '2021-10-30');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Wandering Earth II', 'the_wandering_earth_ii.webp', 'Humans built huge engines on the surface of the earth to find a new home. But the road to the universe is perilous. In order to save earth, young people once again have to step forward to start a race against time for life and death.', '73801827', '0', '173', '2023-01-22');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Rape', 'the_rape.webp', 'Yahagi Michiko is accosted and raped walking home one evening. From there she maneuvers the logistics of the police, hospital, and criminal justice system while balancing her home life including romantic relationships.', '0', '0', '100', '1982-05-15');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Banshees of Inisherin', 'the_banshees_of_inisherin.webp', 'Two lifelong friends find themselves at an impasse when one abruptly ends their relationship, with alarming consequences for both of them.', '0', '41000000', '114', '2022-10-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Dragon Ball Z: Resurrection 'F'', 'dragon_ball_z:_resurrection_'f'.webp', 'One peaceful day on Earth, two remnants of Frieza's army named Sorbet and Tagoma arrive searching for the Dragon Balls with the aim of reviving Frieza. They succeed, and Frieza subsequently seeks revenge on the Saiyans.', '5000000', '61768190', '93', '2015-04-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Dragon Ball Z: Broly – The Legendary Super Saiyan', 'dragon_ball_z:_broly_–_the_legendary_super_saiyan.webp', 'While the Saiyan Paragus persuades Vegeta to rule a new planet, King Kai alerts Goku of the South Galaxy's destruction by an unknown Super Saiyan.', '0', '21658982', '70', '1993-03-06');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Mulan', 'mulan.webp', 'To save her father from certain death in the army, a young woman secretly enlists in his place and becomes one of China's greatest heroines in the process.', '90000000', '304320254', '88', '1998-06-18');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Superman/Shazam!: The Return of Black Adam', 'superman/shazam!:_the_return_of_black_adam.webp', 'Chosen the world’s protector against the Seven Deadly Enemies of Man – pride, envy, greed, hatred, selfishness, laziness and injustice – young Billy Batson accepts his destiny as Captain Marvel. Battling alongside Superman against nefarious Black Adam, Billy soon discovers the challenge super heroes ultimately face: is it revenge or justice?', '0', '0', '25', '2010-11-16');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Berlin Drifters', 'berlin_drifters.webp', 'Kôichi is a Japanese man living alone in Berlin. He has no job and hardly any friends. One night Kôichi meets Ryota at a bar which is also a sex club. Ryota came to Berlin to visit a German guy whom he had "met" on a dating app. His high hopes for romance (and marriage?) were quickly crushed since the German was only interested in sex, not even letting Ryota stay for the night. That is why Ryota ended up spending the night in the dark room of the sex club. Kôichi for some reason lets Ryota stay at his apartment. They have sex. Ryota goes out almost everyday to get laid by various local men and comes home to Kôichi's. Increasingly caught up with a strange feeling that is akin to but not quite frustration or curiosity (needless to say, it is not even close to love), Kôichi gradually gives himself up to sex with Ryota.', '0', '0', '123', '2017-09-10');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('My Hero Academia: Heroes Rising', 'my_hero_academia:_heroes_rising.webp', 'Class 1-A visits Nabu Island where they finally get to do some real hero work. The place is so peaceful that it's more like a vacation … until they're attacked by a villain with an unfathomable Quirk! His power is eerily familiar, and it looks like Shigaraki had a hand in the plan. But with All Might retired and citizens' lives on the line, there's no time for questions. Deku and his friends are the next generation of heroes, and they're the island's only hope.', '0', '29900850', '104', '2019-12-20');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('After We Fell', 'after_we_fell.webp', 'Just as Tessa's life begins to become unglued, nothing is what she thought it would be. Not her friends nor her family. The only person that she should be able to rely on is Hardin, who is furious when he discovers the massive secret that she's been keeping. Before Tessa makes the biggest decision of her life, everything changes because of revelations about her family.', '14000000', '21500000', '99', '2021-09-01');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Unlocked', 'unlocked.webp', 'A woman’s life is turned upside-down when a dangerous man gets a hold of her lost cell phone and uses it to track her every move.', '0', '0', '117', '2023-02-17');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Tomorrow War', 'the_tomorrow_war.webp', 'The world is stunned when a group of time travelers arrive from the year 2051 to deliver an urgent message: Thirty years in the future, mankind is losing a global war against a deadly alien species. The only hope for survival is for soldiers and civilians from the present to be transported to the future and join the fight. Among those recruited is high school teacher and family man Dan Forester. Determined to save the world for his young daughter, Dan teams up with a brilliant scientist and his estranged father in a desperate quest to rewrite the fate of the planet.', '200000000', '14400000', '138', '2021-07-02');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The SpongeBob Movie: Sponge on the Run', 'the_spongebob_movie:_sponge_on_the_run.webp', 'When his best friend Gary is suddenly snatched away, SpongeBob takes Patrick on a madcap mission far beyond Bikini Bottom to save their pink-shelled pal.', '60000000', '4700000', '95', '2020-08-14');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Boyka: Undisputed IV', 'boyka:_undisputed_iv.webp', 'In the fourth installment of the fighting franchise, Boyka is shooting for the big leagues when an accidental death in the ring makes him question everything he stands for. When he finds out the wife of the man he accidentally killed is in trouble, Boyka offers to fight in a series of impossible battles to free her from a life of servitude.', '0', '0', '87', '2016-08-01');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Shutter Island', 'shutter_island.webp', 'World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by troubling visions and a mysterious doctor.', '80000000', '294800000', '138', '2010-02-14');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Twilight Saga: Eclipse', 'the_twilight_saga:_eclipse.webp', 'Bella once again finds herself surrounded by danger as Seattle is ravaged by a string of mysterious killings and a malicious vampire continues her quest for revenge. In the midst of it all, she is forced to choose between her love for Edward and her friendship with Jacob, knowing that her decision has the potential to ignite the ageless struggle between vampire and werewolf. With her graduation quickly approaching, Bella is confronted with the most important decision of her life.', '68000000', '698491347', '124', '2010-06-23');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('The Godfather', 'the_godfather.webp', 'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.', '6000000', '245066411', '175', '1972-03-14');
INSERT INTO `movies` (`name`, `picture`, `description`, `budget`, `revenue`, `duration`, `release_date`) VALUES ('Miraculous World: New York, United HeroeZ', 'miraculous_world:_new_york,_united_heroez.webp', 'Teen Parisian superheroes Ladybug and Chat Noir visit New York on a field trip and discover that superheroes exist in the United States too.', '0', '0', '62', '2020-12-18');
